// src/App.js
import React from "react";
import {
  BrowserRouter as Router,
  Routes,
  Route,
  Navigate,
} from "react-router-dom";

// ✅ Admin Pages
import AdminLogin from "./pages/admin/AdminLogin";
import Dashboard from "./pages/admin/Dashboard";
import CoursesPage from "./pages/admin/CoursePage";
import AddCourse from "./pages/admin/AddCourse";
import LecturesPage from "./pages/admin/LecturesPage";
import AddLecture from "./pages/admin/AddLecture";
import InstructorsPage from "./pages/admin/InstructorsPage";
import AddInstructor from "./pages/admin/AddInstructor";

// ✅ Instructor Pages
import InstructorLogin from "./pages/instructor/InstructorLogin";
import MyLectures from "./pages/instructor/MyLectures";

// ✅ Components
import ProtectedRoute from "./components/ProtectedRoute";
import InstructorProtectedRoute from "./components/InstructorProtectedRoute";

function App() {
  return (
    <Router>
      <Routes>
        {/* ----------------- Admin Routes ----------------- */}
        <Route path="/admin/login" element={<AdminLogin />} />
        <Route
          path="/admin/dashboard"
          element={
            <ProtectedRoute>
              <Dashboard />
            </ProtectedRoute>
          }
        />
        <Route
          path="/admin/courses"
          element={
            <ProtectedRoute>
              <CoursesPage />
            </ProtectedRoute>
          }
        />
        <Route
          path="/admin/courses/add"
          element={
            <ProtectedRoute>
              <AddCourse />
            </ProtectedRoute>
          }
        />
        <Route
          path="/admin/lectures"
          element={
            <ProtectedRoute>
              <LecturesPage />
            </ProtectedRoute>
          }
        />
        <Route
          path="/admin/lectures/add"
          element={
            <ProtectedRoute>
              <AddLecture />
            </ProtectedRoute>
          }
        />
        <Route
          path="/admin/instructors"
          element={
            <ProtectedRoute>
              <InstructorsPage />
            </ProtectedRoute>
          }
        />
        <Route
          path="/admin/instructors/add"
          element={
            <ProtectedRoute>
              <AddInstructor />
            </ProtectedRoute>
          }
        />

        {/* ----------------- Instructor Routes ----------------- */}
        <Route path="/instructor/login" element={<InstructorLogin />} />
        <Route
          path="/instructor/my-lectures"
          element={
            <InstructorProtectedRoute>
              <MyLectures />
            </InstructorProtectedRoute>
          }
        />

        {/* ----------------- Default Redirect ----------------- */}
        <Route path="*" element={<Navigate to="/admin/login" replace />} />
      </Routes>
    </Router>
  );
}

export default App;
